import * as React from 'react';

export const AdvertiseMillionsCard = () => {
  return (
    <div className='w-1/3 bg-red-550'>
      <div className='w-90p'>
        <div>
          <h3
            style={{ fontFamily: 'airbnb-bold' }}
            className='text-gray-750 text-2xl'>
            Guidance to get you set up
          </h3>
        </div>
        <div>
          <p>
            As you’re creating your listing, we’ll ask you the questions that
            guests want to know about when booking. You’ll describe your home,
            providing details like what’s special about the space, including any
            quirks they can expect.
          </p>
        </div>
      </div>
    </div>
  );
};
